script: |
  super -f text -I q9963.spq | sort > q9963.out

inputs:
  - name: q9963.spq
    data: |
      SELECT DISTINCT + tab2.col0 * + tab2.col1 AS col0 FROM tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9963.out
    data: |
      1343
      217
      4602
